google.load('visualization', '1.0');
//---- Maps variables
var map, // The map
		brazilPolygon, // The polygon that colors the country
		marker,// The marker of a lat lng point on map
		serverAddress = 'http://localhost:8182/SAM/';


function initMap () {
	//Map object Contructor
	map = new google.maps.Map(document.getElementById('map_canvas'), {
	  center: new google.maps.LatLng(-16,-53), //Hardcoded Brazil Centralization
	  zoom: 3,
	  mapTypeId: google.maps.MapTypeId.HYBRID,
	  minZoom: 1,
	  maxZoom:8
	});
	google.maps.event.addListenerOnce(map, 'idle', function(){
    // After map is loaded
    google.maps.event.addListener(map, 'click', function(event) {
  		 placeMarker(event.latLng,map);
		});
		//Drawing the brazil polygon on map
		getBrazil(
			function() {
				google.maps.event.addListener(brazilPolygon, 'polygon', function(event) {
      	google.maps.event.trigger(map, 'click', event);});
      	drawHeatmap(getPointsInBrazil());
				endLoadingAnimation();
			}
			);
	});
}
//==== MAP FUNCTIONS =====
//Places a marker on map and start the available points calculation.
function placeMarker(location,map) {
  if ( marker ) {
  	// Set the position of the marker on the map
    marker.setPosition(location);
  } 
  else {
  	// Make new marker if it's not initialized yet
    marker = new google.maps.Marker({
      position: location,
      draggable: true,
      map: map
    });
    google.maps.event.addListener(marker, 'mouseup', function(event) {
  		 placeMarker(event.latLng,map);
		});
  }
  startLoadingAnimation();
  getAvailableChannels(createChannelView,location);
}

// Function that queries a kml file, gets the vertices of brazil and draw them like a polygon on map
function getBrazil(callback){
	// Constructing query for the kml, that has all of the countries...
	var sql = encodeURIComponent("SELECT 'geometry' FROM 1N2LBk4JHwWpOY4d9fobIn27lfnZ5MDy-NoqqRpk WHERE ISO_2DIGIT ='BR'");
	//mount url
	var query = new google.visualization.Query('http://www.google.com/fusiontables/gvizdata?tq=' + sql);
	//send the query
	query.send(function(response){		
		var data = response.getDataTable().getValue(0,0);		
		//Parsing the response
		if (window.DOMParser) {
            var parser = new DOMParser();
            var kml = parser.parseFromString(data, "text/xml");
        } 
    else { // Internet Explorer 
        var kml = new ActiveXObject("Microsoft.XMLDOM");
        kml.loadXML(data);
        }
    //get the coordinates of Brazil
    var latLngs = kml.getElementsByTagName("coordinates")[0].childNodes[0].nodeValue.split(' ');
    //create an array of LatLngs
    var brLatLngs = [];
    for (var i = 0; i < latLngs.length; i++) {
      var latLng = latLngs[i].split(',');
      //<coordinates> for this FusionTable comes in lng,lat format
      brLatLngs.push(new google.maps.LatLng(latLng[1], latLng[0]));
    }
    //initialize the brazil polygon
    brazilPolygon = new google.maps.Polygon({
      paths: brLatLngs,
      fillColor: 'transparent',
      strokeColor : 'transparent',
      map: map
    });
    //make the brazil polygon "transparent" for clicks (pass clicks to map)
    google.maps.event.addListener(brazilPolygon, 'click', function(event) {
    google.maps.event.trigger(map, 'click', event);
    });
    //callback to a function that is waiting for the drawing
	  callback();
    endLoadingAnimation();
	});
}
