function drawHeatmap(data){
	// function that draws a heatmap
	heatmap = new google.maps.visualization.HeatmapLayer({
	data: data,
	});
	heatmap.setMap(map);
}

//Parser for devices coordinates received from the server
function getDevicesCoordinates(data){
	var coords = [];
	for (i in data.list[0]["br.SM.DO.DeviceRange"]){
		var device = data.list[0]["br.SM.DO.DeviceRange"][i];
		coords.push(new google.maps.LatLng(device.latitude,device.longitude));
	};
	return coords;
	
}

function startLoadingAnimation(){
	// Starts the loading animation
	$('#main-container').fadeTo("fast",0.1,function(){
		$('#dvLoading').fadeIn("fast");
	});
}

function endLoadingAnimation(){
	// Finishes the loading animation
	$('#dvLoading').fadeOut("fast", function() {
		$('#main-container').fadeTo("fast",1);
	});
}

function createChannelView(data){
	//Creates one collapsible element with the chanell data (A responsive row with channel details)
	var channelList = $('#accordion');
	channelList.empty();
	$('#channel-title').css('visibility','visible').html("Canais Disponíveis - " + data.list[0]["br.SM.DO.Channel"].length );

	for (i in data.list[0]["br.SM.DO.Channel"]){
		var channel = data.list[0]["br.SM.DO.Channel"][i];
		var row = $('<div>').addClass('row');
		row.css('margin-left',0 );
		row.css('margin-right',0 );
		row.appendTo(channelList);
		var panel = $('<div>').addClass('panel panel-default');
		panel.appendTo(row);
		var panelHeading =  $('<div>').addClass('panel-heading');
		panelHeading.appendTo(panel);
		var titleContainer = $('<h4>').addClass('panel-title').appendTo(panelHeading);
		$('<a>' ,{
			'data-toggle': "collapse",
			'data-parent': "#accordion",
			'href': '#channel-' + channel.id
		}).html('Canal ' + channel.channel).appendTo(titleContainer);
		//================= content
		var panelContent =  $('<div>', {id: 'channel-' + channel.id }).addClass('panel-collapse collapse').appendTo(panel);
		$('<div>').addClass('panel-body').html(
			'Frequencia Média: ' + channel.avgFrequency + '<br>' + 
			'Frequencia Máxima: ' + channel.maxFrequency + '<br>' + 
			'Frequencia Mínima: ' + channel.minFrequency + '<br>' 

			).appendTo(panelContent);
	};
	endLoadingAnimation();
}


//============AJAX REQUEST============//

function getAllDevices(callback) {
	// Returns all the Devices
	$.ajax({
		url:serverAddress + 'devices',
		type: 'GET',
		success: function(data){
			callback(data);
		}
	})
}

function getAvailableChannels(callback,location,modelType) {
	// Get all available channels for a given latlng point
	if (!modelType){
		var modelType = $('.btn-group').find('.active').find('input').prop('name');
	}
	var path = 'model/' + modelType + '/channels/available';
	$.ajax({
	url:serverAddress+path,
	type: 'GET',
	data: { 'lat': location.lat() , 'lng':location.lng()  },
	success: function(data){
		callback(data);
	}
	})
}

