//test functiont that gets all the channels of an array of points ( big array )
function getPoints(location){
	var lat = location[0];
	var lng = location[1];

	if (!modelType){
		// var modelType = $('.btn-group').find('.active').find('input').prop('name');
		var modelType = 2
	}
	var path = 'model/' + modelType + '/channels/available';
	$.ajax({
	url:serverAddress+path,
	type: 'GET',
	data: { 'lat': lat , 'lng':lng  },
	success: function(data){
		heatPoints.push([lat,lng,data.list[0]["br.SM.DO.Channel"].length]);
		if (lat <= 10 &&  lat > -40) {
		// lat -=0.01;
		lat -=1;
		}
		else{
			if (lng > -75 && lng <=-28) {
				// lng -=0.01;
				lng -=1;
				lat = 10;
			};

		};
		if ( -40 - lat == 0 && -75 - lng == 0){
			endLoadingAnimation();
		}		
		else{
			getPoints([lat,lng]);
		}
	},
	error : function(){
		getPoints([lat,lng]);
	}
	})
}

